import Login from './components/login'
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavUp from './components/NavbarUp';
import SideNav from './components/SideNavbar';

function App() {
  return (
    <div className="App">
      <Login/>
      <NavUp />
      <SideNav />
    </div>
  );
}

export default App;
